// Function to safely parse JSON
/**
 * @param {string} str
 */
function safeJSONParse(str) {
  if (typeof str !== 'string') return str;
  try {
    return JSON.parse(str);
  } catch (e) {
    console.warn("Failed to parse JSON:", str);
    return str; // Return the original string if parsing fails
  }
}

