function flattenNestedData(nestedData) {
  /**
   * @type {any[]}
   */
  const flattenedPapers = [];

  /**
   * @param {{ [s: string]: any; } | ArrayLike<any>} obj
   */
  function traverse(obj, path = {}) {
    for (const [key, value] of Object.entries(obj)) {
      if (typeof value === 'object' && value !== null) {
        if (Array.isArray(value)) {
          // We've reached the array of papers
          for (const paper of value) {
            flattenedPapers.push({
              ...path,
              ...paper,
              problems_addressed: safeJSONParse(paper.problems_addressed),
              follow_up_tasks: safeJSONParse(paper.follow_up_tasks),
              alternative_classifications: safeJSONParse(paper.alternative_classifications)
            });
          }
        } else {
          // Continue traversing
          traverse(value, {...path, [key]: key});
        }
      }
    }
  }

  traverse(nestedData);
  return flattenedPapers;
}

